function bouncer(arr) {
  // Don't show a false ID to this bouncer.

  // converting the array to its boolean values
  for(let i = 0; i < arr.length; i++){
    if(Boolean(arr[i]) === false){
       arr.splice(i,1);
       i--;// this is to compensate the element taken out
     }
  }


  return arr;
}

